Sprawdź digital: https://digitalmusic.lnk.to/kafardix37sariusbonson4rano

Kafar, Sarius, Bonson - wszystkich wymienionych raperów mogliście już w przeszłości usłyszeć na naszym kanale. „4 rano” to natomiast pierwszy kawałek, w którym usłyszycie ich wspólnie. Za produkcję numeru odpowiadają Kudel i Leśny.

